  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains the Environmental
  Action Statement, Environmental Assessment, and Interim Hunting and Fishing Plan
  for Big Oaks National Wildlife Refuge from 2004. The Environmental Action Statement
  found that the Refuge does not have significant environmental effects as determined
  by the Environmental Assessment, amendments to the Public Access Plan and Hunting
  and Fishing Plan follow. The Environmental Assessment covers activities on portions
  of Big Oaks National Wildlife Refuge as proposed in the revised Interim Hunting
  and Fishing and Public Access Plans.  Compatibility Determination forms follow,
  which cover hunting, fishing, and collection of wild edible foods and shed deer
  antlers for personal use. The Interim Hunting and Fishing Plan follows. Sections
  covered include: introduction, conformance with statutory authorities, description
  of goals, assessment, description of hunting and fishing program, measures taken
  to avoid conflicts with other management goals, conduct of the hunting and fishing
  program, and public review and comment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
